import React from "react";
import "./App.css";

function App() {
  const genderList = ["Male", "Female", "Others", "Prefer Not to Say"];

  const genderHandler = (gender) => {
    console.log(gender);
  };

  return (
    <div className="App">
      <div className="selectGender">
        <h1>What's your Gender?</h1>
        <div className="genderOptions">
          {" "}
          {genderList.map((item) => {
            return (
              <button
                className="btn"
                onClick={() => {
                  genderHandler(item);
                }}
              >
                {item}
              </button>
            );
          })}
        </div>
      </div>
    </div>
  );
}

export default App;
